    CAST("ADS"."X_0" AS FLOAT) AS "X_0", CAST("ADS"."X_1" AS FLOAT) AS "X_1", CAST("ADS"."X_2" AS FLOAT) AS "X_2", CAST("ADS"."X_3" AS FLOAT) AS "X_3", CAST("ADS"."X_4" AS FLOAT) AS "X_4", CAST("ADS"."X_5" AS FLOAT) AS "X_5", CAST("ADS"."X_6" AS FLOAT) AS "X_6", CAST("ADS"."X_7" AS FLOAT) AS "X_7", CAST("ADS"."X_8" AS FLOAT) AS "X_8", CAST("ADS"."X_9" AS FLOAT) AS "X_9", CAST("ADS"."X_10" AS FLOAT) AS "X_10", CAST("ADS"."X_11" AS FLOAT) AS "X_11", CAST("ADS"."X_12" AS FLOAT) AS "X_12", CAST("ADS"."X_13" AS FLOAT) AS "X_13", CAST("ADS"."X_14" AS FLOAT) AS "X_14", CAST("ADS"."X_15" AS FLOAT) AS "X_15", CAST("ADS"."X_16" AS FLOAT) AS "X_16", CAST("ADS"."X_17" AS FLOAT) AS "X_17", CAST("ADS"."X_18" AS FLOAT) AS "X_18", CAST("ADS"."X_19" AS FLOAT) AS "X_19", CAST("ADS"."X_20" AS FLOAT) AS "X_20", CAST("ADS"."X_21" AS FLOAT) AS "X_21", CAST("ADS"."X_22" AS FLOAT) AS "X_22", CAST("ADS"."X_23" AS FLOAT) AS "X_23", CAST("ADS"."X_24" AS FLOAT) AS "X_24", CAST("ADS"."X_25" AS FLOAT) AS "X_25", CAST("ADS"."X_26" AS FLOAT) AS "X_26", CAST("ADS"."X_27" AS FLOAT) AS "X_27", CAST("ADS"."X_28" AS FLOAT) AS "X_28", CAST("ADS"."X_29" AS FLOAT) AS "X_29", CAST("ADS"."X_30" AS FLOAT) AS "X_30", CAST("ADS"."X_31" AS FLOAT) AS "X_31", CAST("ADS"."X_32" AS FLOAT) AS "X_32", CAST("ADS"."X_33" AS FLOAT) AS "X_33", CAST("ADS"."X_34" AS FLOAT) AS "X_34", CAST("ADS"."X_35" AS FLOAT) AS "X_35", CAST("ADS"."X_36" AS FLOAT) AS "X_36", CAST("ADS"."X_37" AS FLOAT) AS "X_37", CAST("ADS"."X_38" AS FLOAT) AS "X_38", CAST("ADS"."X_39" AS FLOAT) AS "X_39", CAST("ADS"."X_40" AS FLOAT) AS "X_40", CAST("ADS"."X_41" AS FLOAT) AS "X_41", CAST("ADS"."X_42" AS FLOAT) AS "X_42", CAST("ADS"."X_43" AS FLOAT) AS "X_43", CAST("ADS"."X_44" AS FLOAT) AS "X_44", CAST("ADS"."X_45" AS FLOAT) AS "X_45", CAST("ADS"."X_46" AS FLOAT) AS "X_46", CAST("ADS"."X_47" AS FLOAT) AS "X_47", CAST("ADS"."X_48" AS FLOAT) AS "X_48", CAST("ADS"."X_49" AS FLOAT) AS "X_49", CAST("ADS"."X_50" AS FLOAT) AS "X_50", CAST("ADS"."X_51" AS FLOAT) AS "X_51", CAST("ADS"."X_52" AS FLOAT) AS "X_52", CAST("ADS"."X_53" AS FLOAT) AS "X_53", CAST("ADS"."X_54" AS FLOAT) AS "X_54", CAST("ADS"."X_55" AS FLOAT) AS "X_55", CAST("ADS"."X_56" AS FLOAT) AS "X_56", CAST("ADS"."X_57" AS FLOAT) AS "X_57", CAST("ADS"."X_58" AS FLOAT) AS "X_58", CAST("ADS"."X_59" AS FLOAT) AS "X_59", CAST("ADS"."X_60" AS FLOAT) AS "X_60", CAST("ADS"."X_61" AS FLOAT) AS "X_61", CAST("ADS"."X_62" AS FLOAT) AS "X_62", CAST("ADS"."X_63" AS FLOAT) AS "X_63"
  FROM "MLLITE_INPUT_TABLE" AS "ADS" 
 ),
"DT_node_lookup" AS 
 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_5", t1."Leaf_7", t1."Leaf_9", t1."Leaf_10", t1."Leaf_11", t1."Leaf_12", t1."Leaf_18", t1."Leaf_22", t1."Leaf_23", t1."Leaf_24", t1."Leaf_25", t1."Leaf_26", t1."Leaf_27", t1."Leaf_28", t1."Leaf_35", t1."Leaf_36", t1."Leaf_37", t1."Leaf_38", t1."Leaf_43", t1."Leaf_44", t1."Leaf_45", t1."Leaf_46", t1."Leaf_49", t1."Leaf_50", t1."Leaf_51", t1."Leaf_52", t1."Leaf_54", t1."Leaf_55", t1."Leaf_56" ) AS node_id
  FROM
    model_input t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_36" <= 0.500000) AND (t."X_25" <= 0.500000) AND (t."X_42" <= 4.000000)) THEN 5 ELSE NULL END AS Leaf_5,
      CASE WHEN((t."X_36" <= 0.500000) AND (t."X_25" <= 0.500000) AND (t."X_42" > 4.000000) AND (t."X_43" <= 14.500000)) THEN 7 ELSE NULL END AS Leaf_7,
      CASE WHEN((t."X_36" <= 0.500000) AND (t."X_25" <= 0.500000) AND (t."X_42" > 4.000000) AND (t."X_43" > 14.500000) AND (t."X_45" <= 12.000000)) THEN 9 ELSE NULL END AS Leaf_9,
      CASE WHEN((t."X_36" <= 0.500000) AND (t."X_25" <= 0.500000) AND (t."X_42" > 4.000000) AND (t."X_43" > 14.500000) AND (t."X_45" > 12.000000)) THEN 10 ELSE NULL END AS Leaf_10,
      CASE WHEN((t."X_36" <= 0.500000) AND (t."X_25" > 0.500000) AND (t."X_38" <= 2.500000)) THEN 11 ELSE NULL END AS Leaf_11,
      CASE WHEN((t."X_36" <= 0.500000) AND (t."X_25" > 0.500000) AND (t."X_38" > 2.500000)) THEN 12 ELSE NULL END AS Leaf_12,
      CASE WHEN((t."X_36" > 0.500000) AND (t."X_10" <= 3.500000) AND (t."X_13" <= 4.500000) AND (t."X_44" > 12.500000)) THEN 18 ELSE NULL END AS Leaf_18,
      CASE WHEN((t."X_36" > 0.500000) AND (t."X_10" <= 3.500000) AND (t."X_13" > 4.500000) AND (t."X_20" <= 15.500000) AND (t."X_50" > 1.000000)) THEN 22 ELSE NULL END AS Leaf_22,
      CASE WHEN((t."X_36" > 0.500000) AND (t."X_10" <= 3.500000) AND (t."X_13" > 4.500000) AND (t."X_20" <= 15.500000) AND (t."X_50" <= 1.000000) AND (t."X_27" <= 9.500000)) THEN 23 ELSE NULL END AS Leaf_23,
      CASE WHEN((t."X_36" > 0.500000) AND (t."X_10" <= 3.500000) AND (t."X_13" > 4.500000) AND (t."X_20" <= 15.500000) AND (t."X_50" <= 1.000000) AND (t."X_27" > 9.500000)) THEN 24 ELSE NULL END AS Leaf_24,
      CASE WHEN((t."X_36" > 0.500000) AND (t."X_10" <= 3.500000) AND (t."X_13" <= 4.500000) AND (t."X_44" <= 12.500000) AND (t."X_42" <= 9.500000)) THEN 25 ELSE NULL END AS Leaf_25,
      CASE WHEN((t."X_36" > 0.500000) AND (t."X_10" <= 3.500000) AND (t."X_13" <= 4.500000) AND (t."X_44" <= 12.500000) AND (t."X_42" > 9.500000)) THEN 26 ELSE NULL END AS Leaf_26,
      CASE WHEN((t."X_36" > 0.500000) AND (t."X_10" <= 3.500000) AND (t."X_13" > 4.500000) AND (t."X_20" > 15.500000) AND (t."X_38" <= 8.500000)) THEN 27 ELSE NULL END AS Leaf_27,
      CASE WHEN((t."X_36" > 0.500000) AND (t."X_10" <= 3.500000) AND (t."X_13" > 4.500000) AND (t."X_20" > 15.500000) AND (t."X_38" > 8.500000)) THEN 28 ELSE NULL END AS Leaf_28,
      CASE WHEN((t."X_36" > 0.500000) AND (t."X_10" > 3.500000) AND (t."X_43" <= 1.500000) AND (t."X_26" > 4.500000) AND (t."X_29" <= 9.500000) AND (t."X_42" <= 9.500000)) THEN 35 ELSE NULL END AS Leaf_35,
      CASE WHEN((t."X_36" > 0.500000) AND (t."X_10" > 3.500000) AND (t."X_43" <= 1.500000) AND (t."X_26" > 4.500000) AND (t."X_29" <= 9.500000) AND (t."X_42" > 9.500000)) THEN 36 ELSE NULL END AS Leaf_36,
      CASE WHEN((t."X_36" > 0.500000) AND (t."X_10" > 3.500000) AND (t."X_43" <= 1.500000) AND (t."X_26" > 4.500000) AND (t."X_29" > 9.500000) AND (t."X_6" <= 10.500000)) THEN 37 ELSE NULL END AS Leaf_37,
      CASE WHEN((t."X_36" > 0.500000) AND (t."X_10" > 3.500000) AND (t."X_43" <= 1.500000) AND (t."X_26" > 4.500000) AND (t."X_29" > 9.500000) AND (t."X_6" > 10.500000)) THEN 38 ELSE NULL END AS Leaf_38,
      CASE WHEN((t."X_36" > 0.500000) AND (t."X_10" > 3.500000) AND (t."X_43" > 1.500000) AND (t."X_61" <= 0.500000) AND (t."X_29" <= 1.500000) AND (t."X_20" <= 9.000000)) THEN 43 ELSE NULL END AS Leaf_43,
      CASE WHEN((t."X_36" > 0.500000) AND (t."X_10" > 3.500000) AND (t."X_43" > 1.500000) AND (t."X_61" <= 0.500000) AND (t."X_29" <= 1.500000) AND (t."X_20" > 9.000000)) THEN 44 ELSE NULL END AS Leaf_44,
      CASE WHEN((t."X_36" > 0.500000) AND (t."X_10" > 3.500000) AND (t."X_43" > 1.500000) AND (t."X_61" <= 0.500000) AND (t."X_29" > 1.500000) AND (t."X_13" <= 3.000000)) THEN 45 ELSE NULL END AS Leaf_45,
      CASE WHEN((t."X_36" > 0.500000) AND (t."X_10" > 3.500000) AND (t."X_43" > 1.500000) AND (t."X_61" <= 0.500000) AND (t."X_29" > 1.500000) AND (t."X_13" > 3.000000)) THEN 46 ELSE NULL END AS Leaf_46,
      CASE WHEN((t."X_36" > 0.500000) AND (t."X_10" > 3.500000) AND (t."X_43" > 1.500000) AND (t."X_61" > 0.500000) AND (t."X_46" <= 5.500000) AND (t."X_21" <= 8.500000)) THEN 49 ELSE NULL END AS Leaf_49,
      CASE WHEN((t."X_36" > 0.500000) AND (t."X_10" > 3.500000) AND (t."X_43" > 1.500000) AND (t."X_61" > 0.500000) AND (t."X_46" <= 5.500000) AND (t."X_21" > 8.500000)) THEN 50 ELSE NULL END AS Leaf_50,
      CASE WHEN((t."X_36" > 0.500000) AND (t."X_10" > 3.500000) AND (t."X_43" > 1.500000) AND (t."X_61" > 0.500000) AND (t."X_46" > 5.500000) AND (t."X_21" <= 4.500000)) THEN 51 ELSE NULL END AS Leaf_51,
      CASE WHEN((t."X_36" > 0.500000) AND (t."X_10" > 3.500000) AND (t."X_43" > 1.500000) AND (t."X_61" > 0.500000) AND (t."X_46" > 5.500000) AND (t."X_21" > 4.500000)) THEN 52 ELSE NULL END AS Leaf_52,
      CASE WHEN((t."X_36" > 0.500000) AND (t."X_10" > 3.500000) AND (t."X_43" <= 1.500000) AND (t."X_26" <= 4.500000) AND (t."X_30" > 2.000000)) THEN 54 ELSE NULL END AS Leaf_54,
      CASE WHEN((t."X_36" > 0.500000) AND (t."X_10" > 3.500000) AND (t."X_43" <= 1.500000) AND (t."X_26" <= 4.500000) AND (t."X_30" <= 2.000000) AND (t."X_37" <= 1.500000)) THEN 55 ELSE NULL END AS Leaf_55,
      CASE WHEN((t."X_36" > 0.500000) AND (t."X_10" > 3.500000) AND (t."X_43" <= 1.500000) AND (t."X_26" <= 4.500000) AND (t."X_30" <= 2.000000) AND (t."X_37" > 1.500000)) THEN 56 ELSE NULL END AS Leaf_56
    FROM model_input t
    ) AS t1
    ON(t."index" == t1."index")
 ),
